css:
atom-text-editor .gutter[gutter-name="com.alexcorre.git-blame"] {
  border-right: 2px solid rgba(0, 0, 0, 0.5);
  border-left: 2px solid rgba(0, 0, 0, 0.5);
}
atom-text-editor .gutter[gutter-name="com.alexcorre.git-blame"] .blame-line-marker {
  width: 100%;
}
atom-text-editor .gutter[gutter-name="com.alexcorre.git-blame"] .resize-container .resize {
  position: absolute;
  top: 0;
  bottom: 0;
  right: 0;
  width: 8px;
  cursor: col-resize;
}
atom-text-editor .gutter[gutter-name="com.alexcorre.git-blame"] .blame-line {
  width: 100%;
  overflow: hidden;
  text-overflow: ellipsis;
  text-align: left;
  white-space: nowrap;
  padding: 0 4px;
}
atom-text-editor .gutter[gutter-name="com.alexcorre.git-blame"] .blame-line.lighter {
  background-color: #303337;
}
atom-text-editor .gutter[gutter-name="com.alexcorre.git-blame"] .blame-line.darker {
  background-color: #222426;
}
atom-text-editor .gutter[gutter-name="com.alexcorre.git-blame"] .blame-line.no-commit .committer,
atom-text-editor .gutter[gutter-name="com.alexcorre.git-blame"] .blame-line.no-commit .date {
  display: none;
}
atom-text-editor .gutter[gutter-name="com.alexcorre.git-blame"] .blame-line a.hash {
  color: #aaa;
  text-decoration: none;
}
atom-text-editor .gutter[gutter-name="com.alexcorre.git-blame"] .blame-line a.hash:hover {
  text-decoration: underline;
}
atom-text-editor .gutter[gutter-name="com.alexcorre.git-blame"] .blame-line .hash,
atom-text-editor .gutter[gutter-name="com.alexcorre.git-blame"] .blame-line .date {
  padding-right: 10px;
}
